import React, { useState } from "react";

export default function BracketValidator() {
  const [inputString, setInputString] = useState("");
  const [history, setHistory] = useState([]);

  function handleSubmit(event) {
    event.preventDefault();
    const stack = [];
    var missing = null;
    const openingBracketStack = [];

    const map = {
      '(': ')',
      '[': ']',
      '{': '}',
      '<': '>',
    }

    const map2 = {
      ')': '(',
      ']': '[',
      '}': '{',
      '>': '<',
    }

    var isBracketValid = function(s) {   

      
      for (let i = 0 ; i < s.length ; i++) {
          let c = s[i];
          if (map[c]) {
            stack.push(map[c])
          }
          else{
            var potential = stack[stack.length-1];
            if (c!=potential){
              missing = c;
              return false;
            }
            stack.pop();
          }
      }
      return !stack.length;
  };

    if (isBracketValid(inputString)) {
      setHistory((prevHistory) => [...prevHistory, { string: inputString, reason: "Valid" }]);
    }
    else if (missing){
      if (map[missing]){
        var openingpair = map[missing];
        let str = 'Invalid opening bracket ' + missing +', missing closing bracket  '+ openingpair
        setHistory((prevHistory) => [...prevHistory, { string: inputString, reason: str}]);
      }
      else if (map2[missing]){
        var prev = stack[stack.length-1];
        let str = null;
        if (prev && missing != map2[prev]){

           str = 'Invalid closing bracket ' + missing +', missing closing bracket  '+ prev

        }
        else{
           str = 'Invalid closing bracket ' + missing +', missing opening bracket  '+ map2[missing]

        }
        setHistory((prevHistory) => [...prevHistory, { string: inputString, reason: str}]);
      }
    }
    else if (stack.length){
      var missingClosing = stack[0];
      var closingPair = map2[missingClosing];
      let str = ' Invalid opening bracket ' + closingPair +', missing closing bracket  '+ missingClosing
      setHistory((prevHistory) => [...prevHistory, { string: inputString, reason: str}]);
    }
    
  }

  return (
    <div>
<head>
    <title>Client Manager</title>
</head>
<body>
    <div id="app">
        <h1>Client Manager</h1>

        <h2>Add New Client</h2>
        <form id="client-form">
            <label>
                First Name:
                <input type="text" id="first-name" />
            </label>
            <label>
                Last Name:
                <input type="text" id="last-name" />
            </label>
            <label>
                DOB:
                <input type="date" id="dob" />
            </label>
            <label>
                Email:
                <input type="email" id="email" />
            </label>
            <label>
                Address:
                <input type="text" id="address" />
            </label>
            <label>
                Status:
                <select id="status">
                    <option value="New">New</option>
                    <option value="Active">Active</option>
                    <option value="Inactive">Inactive</option>
                </select>
            </label>
            <button type="submit">Add Client</button>
        </form>

        <h2>Clients</h2>
        <label>
            Filter by status:
            <select id="filter-status">
                <option value="">All</option>
                <option value="New">New</option>
                <option value="Active">Active</option>
                <option value="Inactive">Inactive</option>
            </select>
        </label>
        <div class="client-list" id="client-list"></div>
    </div>

    <script src="app.js"></script>
</body>
</div>
  )
}
